import './Resume.css';
import { navigate, Link } from '@reach/router';


export default (props) =>{


    return(
        <div className="container">
            <div className="col-12 text-right mt-2">
                <Link to = "/"> <button className='btn btn-outline-light'> Home </button> </Link>
            </div>

            <div className="col-12 resume mt-2">
                <h1> Kevin R. Chancey </h1>
                <p>Full-Stack Software Developer</p>

                <h5>Professional Skills</h5>
                <p>HTML5 - CSS - JQuery - Git - Github - SQL - MySQL - Django - MongoDB - React - Mongoose - Express - ASP.NET - Deployment - BootStrap - Working in Teams - Problem Solving - Postman - VS Code - API - RESTful API - MVC - MVT - Wireframe - AWS - JavaScript - Algorithms - Remote Work Experience - Node.j</p>

                <h5>Professional Skills</h5>
                <p>Apex Facility Resources / Kent, WA - Operations & Dispatch Â Feb 2019   -   March   2020 </p>
            </div>
        </div>
    )
}
